import React from "react";
import { CircularProgressbar, buildStyles } from 'react-circular-progressbar';
import 'react-circular-progressbar/dist/styles.css';

export const RatingsBar = ({ number }) => {
    <CircularProgressbar 
        value={number} 
        text={number} 
        minValue={0}
        maxValue={10}
        styles={buildStyles({
            strokeLinecap: "butt"
          })}/>
}
